import Link from "next/link";
import Head from 'next/head'

function Navbar(){
    return (
        <div>
            <Head>
                <title>Techronx</title>
                {/* <link href="/Navbar.css" rel="stylesheet" key="test"/> */}
            </Head>
        <header className="landing">

          <div className="navbar-header">
            <div className="nav-logo">
             
           </div>


           <div className="nav-tool">
             <Link className="navlink nav-hide" href="/"><a >Home</a></Link>
             <Link className="navlink nav-hide" href="/blog"><a>Blog</a></Link>
             <Link className="navlink nav-hide" href="/about"><a>About</a></Link>
             <Link className="navlink nav-hide" href="/services"><a>Services</a></Link>
             <Link className="navlink nav-hide" href="/contact"><a>Contact</a></Link> 
           </div>
          </div>
         
   
        </header>
        <style jsx>{`
            .landing{
                /* height:105vh; */
            
                width:100%;
                display:flex;
                flex-direction:column;
                flex-wrap: wrap;
                background: #000000;;
                /* border-top:1000px red;
                border-right: 1000px solid white; 
                border-left:1000px solid white; */
            }
            
            .navbar-header{
                height:4rem;
                /* position:absolute; */
                display:flex;
                flex-direction:row;
                align-items: center;
                justify-content: space-between;  
                padding:0rem 3rem;  
            }
            .nav-logo img{
                height:3rem;
                
            }
            
            .nav-tool{
               
                display:flex;
                flex-direction:row;
                justify-content: space-between;  
            }
            .nav-tool .navlink a{
                text-decoration:none;
            }
            .nav-icon{
                color:white;
            }

            a{
                text-decoration: none;
                color:white;
                padding:0 1.5rem;
            }
            .nav-tool .navlink.active{
               color:blue;
               font-weight:bold;
            }
            
            .icon-bar{
                display:none;
            }
            
            @media (max-width:800px){
                .nav-tool{
                    display:none;
                }
                .icon-bar{
                    display:block;
                    height:4rem;
                    width:250px;
                    float:right;
                    background:red;
                }
                .navbar-header{
                    padding:0 1rem;
                }
            }
        `}</style>
        </div>
    )
}

export default Navbar;
